INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 1, 1, 60000, 0, 1, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 2, 60000, 1, 1, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 3, 60000, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 4, 60000, 1, 2, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 5, 60000, 2, 1, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 6, 60000, 2, 1, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 7, 60000, 2, 2, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 8, 60000, 3, 1, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 9, 60000, 3, 1, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 10, 60000, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 11, 60000, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 12, 60000, 3, 2, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 13, 60000, 4, 1, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 14, 60000, 4, 1, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 15, 60000, 4, 1, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 16, 60000, 4, 1, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 17, 60000, 4, 2, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 3, 18, 60000, 0, 0, 2, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 3, 19, 60000, 0, 0, 3, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 20, 80001, 0, 0, 1, "ハツネ", "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 0, 101201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 21, 80001, 0, 0, 2, "ハツネ", "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 0, 101201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 22, 80001, 0, 0, 1, "シオリ", "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 0, 103801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 23, 80001, 0, 0, 2, "シオリ", "来年も、\n一緒にいられたら…\nうれしいな", 0, 103801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 24, 80001, 0, 0, 1, "キョウカ", "あなたと一緒にいるようになって、\nもう1年ですか…", 0, 103601);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 25, 80001, 0, 0, 2, "キョウカ", "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 0, 103601);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 26, 80001, 0, 0, 1, "ミミ", "おにいちゃんとあってから、\n1年たったよ～！", 0, 102001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 27, 80001, 0, 0, 2, "ミミ", "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 0, 102001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 2, 28, 80001, 0, 0, 1, "ミソギ", "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 0, 100401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 2, 29, 80001, 0, 0, 2, "ミソギ", "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 0, 100401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 30, 80001, 0, 0, 1, "マホ", "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 0, 101001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 31, 80001, 0, 0, 2, "マホ", "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 0, 101001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 32, 80001, 0, 0, 1, "イリヤ", "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 0, 104401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 33, 80001, 0, 0, 2, "イリヤ", "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 0, 104401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 2, 34, 80001, 0, 0, 1, "カオリ", "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 0, 101701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 2, 35, 80001, 0, 0, 2, "カオリ", "これからも、どうぞよろしく\nお願いするさ～！", 0, 101701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 36, 80001, 0, 0, 1, "サレン", "あんたと出会ってからもうそんなに\nたつのね～", 0, 102801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 37, 80001, 0, 0, 2, "サレン", "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 0, 102801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 38, 80001, 0, 0, 1, "スズメ", "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 0, 102501);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 39, 80001, 0, 0, 2, "スズメ", "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 0, 102501);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 40, 80001, 0, 0, 1, "タマキ", "振り返れば、今までいろんなことが\nあったにゃあ…", 0, 104601);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 41, 80001, 0, 0, 2, "タマキ", "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 0, 104601);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 42, 80001, 0, 0, 1, "ミフユ", "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 0, 104801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 43, 80001, 0, 0, 2, "ミフユ", "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 0, 104801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 44, 80001, 0, 0, 1, "アキノ", "あなたさまと出会ってもう1年…", 0, 103201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 45, 80001, 0, 0, 2, "アキノ", "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 0, 103201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 46, 80001, 0, 0, 1, "ユカリ", "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 0, 103401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 47, 80001, 0, 0, 2, "ユカリ", "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 0, 103401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 48, 80001, 0, 0, 1, "クリスティーナ", "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 0, 107101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 49, 80001, 0, 0, 2, "クリスティーナ", "ともかくこれからも\n愉しませてくれよ☆", 0, 107101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 1, 50, 80001, 0, 0, 1, "ジュン", "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 0, 104701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 1, 51, 80001, 0, 0, 2, "ジュン", "見えないから分からないって？\nそれもそうだな…", 0, 104701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 52, 80001, 0, 0, 1, "トモ", "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 0, 103701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 53, 80001, 0, 0, 2, "トモ", "これからもよろしくね！", 0, 103701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 1, 54, 80001, 0, 0, 1, "マツリ", "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 0, 100501);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 1, 55, 80001, 0, 0, 2, "マツリ", "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 0, 100501);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 56, 80001, 0, 0, 1, "ミヤコ", "オマエと会って1年なの！\n全然成仏もできなかったし、", 0, 100701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 57, 80001, 0, 0, 2, "ミヤコ", "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 0, 100701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 1, 58, 80001, 0, 0, 1, "シノブ", "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 0, 103101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 1, 59, 80001, 0, 0, 2, "シノブ", "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 0, 103101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 60, 80001, 0, 0, 1, "アンナ", "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 0, 100901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 61, 80001, 0, 0, 2, "アンナ", "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 0, 100901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 1, 62, 80001, 0, 0, 1, "ナナカ", "君と出会ってもう1年だって！\n早いねー！", 0, 101301);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 1, 63, 80001, 0, 0, 2, "ナナカ", "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 0, 101301);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 64, 80001, 0, 0, 1, "ミツキ", "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 0, 105101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 65, 80001, 0, 0, 2, "ミツキ", "これからも、いろんなところを\n調べさせてね？", 0, 105101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 1, 66, 80001, 0, 0, 1, "ルカ", "お前さんと出会ってもう1年か\n助太刀するつもりが", 0, 105601);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 1, 67, 80001, 0, 0, 2, "ルカ", "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 0, 105601);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 2, 68, 80001, 0, 0, 1, "エリコ", "早いものですわね、あなた様と\nお会いして、もう1年…", 0, 102701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 2, 69, 80001, 0, 0, 2, "エリコ", "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 0, 102701);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 0, 70, 80001, 0, 0, 1, "アヤネ", "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 0, 102301);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 0, 71, 80001, 0, 0, 2, "アヤネ", "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 0, 102301);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 1, 72, 80001, 0, 0, 1, "チカ", "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 0, 104201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 1, 73, 80001, 0, 0, 2, "チカ", "私のことを見守ってください\nできることなら、ずっと…", 0, 104201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 74, 80001, 0, 0, 1, "クルミ", "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 0, 102101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 75, 80001, 0, 0, 2, "クルミ", "で、でもこれからもずっと…\n一緒にいたいなぁ…", 0, 102101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 76, 80001, 0, 0, 1, "シズル", "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 0, 104901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 77, 80001, 0, 0, 2, "シズル", "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 0, 104901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 78, 80001, 0, 0, 1, "リノ", "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 0, 101101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 79, 80001, 0, 0, 2, "リノ", "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 0, 101101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 80, 80001, 0, 0, 1, "ユイ", "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 0, 100201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 81, 80001, 0, 0, 2, "ユイ", "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 0, 100201);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 1, 82, 80001, 0, 0, 1, "ヒヨリ", "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 0, 100101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 1, 83, 80001, 0, 0, 2, "ヒヨリ", "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 0, 100101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 84, 80001, 0, 0, 1, "レイ", "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 0, 100301);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 85, 80001, 0, 0, 2, "レイ", "キミに背中を預けられる日が、\n早くきますように", 0, 100301);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 86, 80001, 0, 0, 1, "ペコリーヌ", "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 87, 80001, 0, 0, 2, "ペコリーヌ", "これからもずっと、覚えていて\nくださいね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 88, 80001, 0, 0, 1, "コッコロ", "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 89, 80001, 0, 0, 2, "コッコロ", "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 90, 80001, 0, 0, 1, "キャル", "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 91, 80001, 0, 0, 2, "キャル", "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 1, 92, 60001, 0, 1, 1, "スズメ", "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 0, 112101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 93, 60001, 1, 1, 0, "", "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 94, 60001, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 95, 60001, 1, 1, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 96, 60001, 1, 1, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 97, 60001, 1, 2, 0, "", "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 98, 60001, 2, 1, 0, "", "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 99, 60001, 2, 1, 0, "", "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 100, 60001, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 101, 60001, 2, 1, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 102, 60001, 2, 2, 0, "", "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 103, 60001, 3, 1, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 104, 60001, 3, 1, 0, "", "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 105, 60001, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 106, 60001, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 107, 60001, 3, 1, 0, "", "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 108, 60001, 3, 1, 0, "", "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 109, 60001, 3, 2, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 110, 60001, 4, 1, 0, "", "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 111, 60001, 4, 1, 0, "", "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 112, 60001, 4, 1, 0, "", "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 113, 60001, 4, 1, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 114, 60001, 4, 1, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 115, 60001, 4, 1, 0, "", "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 116, 60001, 4, 2, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 3, 117, 60001, 0, 0, 2, "スズメ", "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 0, 112101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 3, 118, 60001, 0, 0, 3, "スズメ", "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 0, 112101);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 119, 80003, 0, 0, 1, "ペコリーヌ", "ヒューヒュー♪\nドンドンパフパフー♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 120, 80003, 0, 0, 1, "コッコロ", "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 121, 80003, 0, 0, 2, "コッコロ", "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 122, 80003, 0, 0, 1, "キャル", "え？　ちょっと\nいきなりなにっ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 123, 80003, 0, 0, 2, "キャル", "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 124, 80003, 0, 0, 2, "ペコリーヌ", "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 125, 80003, 0, 0, 3, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 126, 80003, 0, 0, 3, "コッコロ", "ですからその日に向けて\n今から気分を盛り上げているのです", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 127, 80003, 0, 0, 3, "キャル", "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 128, 80003, 0, 0, 4, "コッコロ", "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 129, 80003, 0, 0, 4, "ペコリーヌ", "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 130, 80003, 0, 0, 4, "キャル", "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 131, 80003, 0, 0, 5, "コッコロ", "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 132, 80003, 0, 0, 5, "キャル", "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 133, 80003, 0, 0, 1, "カリン", "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 134, 80003, 0, 0, 6, "キャル", "げっ…カリンじゃない\nなんでもないわよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 135, 80003, 0, 0, 2, "カリン", "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 136, 80003, 0, 0, 7, "キャル", "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 137, 80003, 0, 0, 3, "カリン", "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 138, 80003, 0, 0, 8, "キャル", "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 139, 80003, 0, 0, 9, "キャル", "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 140, 80003, 0, 0, 4, "カリン", "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 141, 80003, 0, 0, 10, "キャル", "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 142, 80003, 0, 0, 5, "カリン", "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 143, 80003, 0, 0, 11, "キャル", "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 144, 80003, 0, 0, 6, "コッコロ", "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 145, 80003, 0, 0, 5, "ペコリーヌ", "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 146, 80003, 0, 0, 7, "コッコロ", "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 147, 80003, 0, 0, 8, "コッコロ", "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 148, 80003, 0, 0, 6, "ペコリーヌ", "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 149, 80003, 0, 0, 7, "ペコリーヌ", "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 150, 80003, 0, 0, 9, "コッコロ", "あとは、牧場に素敵な温泉が\n出来たとか…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 151, 80003, 0, 0, 8, "ペコリーヌ", "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 152, 80003, 0, 0, 10, "コッコロ", "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 153, 80003, 0, 0, 9, "ペコリーヌ", "えへへ、ありがとうございます\nコッコロちゃん！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 154, 80003, 0, 0, 11, "コッコロ", "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 155, 80003, 0, 0, 10, "ペコリーヌ", "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 156, 80003, 0, 0, 11, "ペコリーヌ", "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 157, 80003, 0, 0, 12, "キャル", "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 158, 80003, 0, 0, 12, "ペコリーヌ", "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 159, 80003, 0, 0, 13, "キャル", "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 160, 80003, 0, 0, 13, "ペコリーヌ", "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 161, 80003, 0, 0, 14, "キャル", "…積極的？\nなんの話よ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 162, 80003, 0, 0, 14, "ペコリーヌ", "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 163, 80003, 0, 0, 15, "ペコリーヌ", "ムーサの町で\nきゃるきゃる～ん☆　って！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 164, 80003, 0, 0, 15, "キャル", "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 165, 80003, 0, 0, 16, "ペコリーヌ", "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 166, 80003, 0, 0, 16, "キャル", "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 167, 80003, 0, 0, 17, "キャル", "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 168, 80003, 0, 0, 18, "キャル", "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 169, 80003, 0, 0, 12, "コッコロ", "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 170, 80003, 0, 0, 19, "キャル", "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 171, 80003, 0, 0, 13, "コッコロ", "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 172, 80003, 0, 0, 20, "キャル", "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 173, 80003, 0, 0, 14, "コッコロ", "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 174, 80003, 0, 0, 21, "キャル", "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 175, 80003, 0, 0, 15, "コッコロ", "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 176, 80003, 0, 0, 22, "キャル", "かくし芸？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 177, 80003, 0, 0, 16, "コッコロ", "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 178, 80003, 0, 0, 23, "キャル", "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 179, 80003, 0, 0, 17, "ペコリーヌ", "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 180, 80003, 0, 0, 24, "キャル", "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 181, 80003, 0, 0, 17, "コッコロ", "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 182, 80003, 0, 0, 18, "ペコリーヌ", "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 183, 80003, 0, 0, 25, "キャル", "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 184, 80003, 0, 0, 18, "コッコロ", "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 185, 80003, 0, 0, 26, "キャル", "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 186, 80003, 0, 0, 27, "キャル", "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 187, 80003, 0, 0, 28, "キャル", "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 188, 80003, 0, 0, 19, "ペコリーヌ", "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 189, 80003, 0, 0, 19, "コッコロ", "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 190, 80003, 0, 0, 29, "キャル", "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 191, 80003, 0, 0, 30, "キャル", "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 192, 80003, 0, 0, 31, "キャル", "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 193, 80003, 0, 0, 32, "キャル", "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 194, 80003, 0, 0, 33, "キャル", "あー\nあー\n…声、これで大丈夫かしら？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 195, 80003, 0, 0, 34, "キャル", "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 196, 80003, 0, 0, 35, "キャル", "オイッスー☆", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 197, 80003, 0, 0, 36, "キャル", "……\nいや、ないわ\nいつもどおりが一番ね、うん", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 198, 80003, 0, 0, 37, "キャル", "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 199, 80003, 0, 0, 38, "キャル", "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 200, 80003, 0, 0, 20, "コッコロ", "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 201, 80003, 0, 0, 21, "コッコロ", "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 202, 80003, 0, 0, 22, "コッコロ", "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 203, 80003, 0, 0, 23, "コッコロ", "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 204, 80003, 0, 0, 24, "コッコロ", "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 205, 80003, 0, 0, 25, "コッコロ", "オイッスー☆", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 206, 80003, 0, 0, 26, "コッコロ", "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 207, 80003, 0, 0, 27, "コッコロ", "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 208, 80003, 0, 0, 28, "コッコロ", "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 209, 80003, 0, 0, 20, "ペコリーヌ", "オイッスー☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 210, 80003, 0, 0, 21, "ペコリーヌ", "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 211, 80003, 0, 0, 22, "ペコリーヌ", "あと６日で2.5周年ですか…", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 212, 80003, 0, 0, 23, "ペコリーヌ", "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 213, 80003, 0, 0, 24, "ペコリーヌ", "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 214, 80003, 0, 0, 25, "ペコリーヌ", "オイッスー☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 215, 80003, 0, 0, 26, "ペコリーヌ", "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 216, 80003, 0, 0, 27, "ペコリーヌ", "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 217, 80003, 0, 0, 28, "ペコリーヌ", "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 218, 80003, 0, 0, 29, "ペコリーヌ", "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 219, 80003, 0, 0, 30, "ペコリーヌ", "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 220, 80003, 0, 0, 31, "ペコリーヌ", "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 1, 221, 80003, 0, 0, 29, "コッコロ", "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 222, 80003, 0, 0, 32, "ペコリーヌ", "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 2, 223, 80003, 0, 0, 39, "キャル", "…………", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 1, 224, 80003, 0, 0, 30, "コッコロ", "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 2, 225, 80003, 0, 0, 40, "キャル", "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 226, 80003, 0, 0, 33, "ペコリーヌ", "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 2, 227, 80003, 0, 0, 41, "キャル", "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 228, 80003, 0, 0, 34, "ペコリーヌ", "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 229, 80003, 0, 0, 35, "ペコリーヌ", "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 2, 230, 80003, 0, 0, 42, "キャル", "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 1, 231, 80003, 0, 0, 31, "コッコロ", "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 2, 232, 80003, 0, 0, 43, "キャル", "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 233, 80003, 0, 0, 36, "ペコリーヌ", "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 234, 80003, 0, 0, 6, "カリン", "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 235, 80003, 0, 0, 7, "カリン", "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 236, 80003, 0, 0, 8, "カリン", "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 237, 80003, 0, 0, 9, "カリン", "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 238, 80003, 0, 0, 10, "カリン", "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 239, 80003, 0, 0, 11, "カリン", "次にコッコロさんですが\nこちらは発声練習をしています", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 240, 80003, 0, 0, 12, "カリン", "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 241, 80003, 0, 0, 13, "カリン", "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 242, 80003, 0, 0, 14, "カリン", "あれ？\nもしかして緊張で気を失って…？", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 243, 80003, 0, 0, 15, "カリン", "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 244, 80003, 0, 0, 16, "カリン", "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 245, 80003, 0, 0, 17, "カリン", "それでは\nまた明日お会いしましょう♪", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 0, 246, 80003, 0, 0, 44, "キャル", "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 247, 80003, 0, 0, 37, "ペコリーヌ", "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 1, 248, 80003, 0, 0, 32, "コッコロ", "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 0, 249, 80003, 0, 0, 45, "キャル", "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 250, 80003, 0, 0, 38, "ペコリーヌ", "ひどいですよぉキャルちゃ～ん！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 1, 251, 80003, 0, 0, 33, "コッコロ", "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 252, 80003, 0, 0, 39, "ペコリーヌ", "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 0, 253, 80003, 0, 0, 46, "キャル", "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 1, 254, 80003, 0, 0, 34, "コッコロ", "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 255, 80003, 0, 0, 40, "ペコリーヌ", "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 256, 80003, 0, 0, 41, "ペコリーヌ", "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 257, 80003, 0, 0, 47, "キャル", "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 258, 80003, 0, 0, 42, "ペコリーヌ", "忘れてきちゃいました☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 259, 80003, 0, 0, 48, "キャル", "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 260, 80003, 0, 0, 35, "コッコロ", "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 261, 80003, 0, 0, 49, "キャル", "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 262, 80003, 0, 0, 43, "ペコリーヌ", "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 263, 80003, 0, 0, 50, "キャル", "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 264, 80003, 0, 0, 36, "コッコロ", "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 265, 80003, 0, 0, 51, "キャル", "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 266, 80003, 0, 0, 37, "コッコロ", "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 267, 80003, 0, 0, 52, "キャル", "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 268, 80003, 0, 0, 44, "ペコリーヌ", "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 269, 80003, 0, 0, 38, "コッコロ", "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 270, 80003, 0, 0, 45, "ペコリーヌ", "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 271, 80003, 0, 0, 53, "キャル", "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 272, 80003, 0, 0, 46, "ペコリーヌ", "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 273, 80003, 0, 0, 18, "カリン", "こんにちは\n【ギルド管理協会】のカリンです", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 274, 80003, 0, 0, 19, "カリン", "昨日の生放送は\nいかがだったでしょうか？", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 275, 80003, 0, 0, 20, "カリン", "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 276, 80003, 0, 0, 21, "カリン", "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 277, 80003, 0, 0, 22, "カリン", "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 278, 80003, 0, 0, 23, "カリン", "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 279, 80003, 0, 0, 24, "カリン", "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 280, 80003, 0, 0, 25, "カリン", "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 281, 80003, 0, 0, 26, "カリン", "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 282, 80003, 0, 0, 27, "カリン", "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 283, 80003, 0, 0, 47, "ペコリーヌ", "準備はいいですかっ？\n…いっきますよー！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 284, 80003, 0, 0, 54, "キャル", "祝！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 285, 80003, 0, 0, 39, "コッコロ", "2.5周年！", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 286, 80003, 0, 0, 48, "ペコリーヌ", "おめでとうございま～す☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 287, 80003, 0, 0, 55, "キャル", "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 288, 80003, 0, 0, 40, "コッコロ", "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 289, 80003, 0, 0, 49, "ペコリーヌ", "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 290, 80003, 0, 0, 56, "キャル", "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 291, 80003, 0, 0, 41, "コッコロ", "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 292, 80003, 0, 0, 57, "キャル", "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 293, 80003, 0, 0, 50, "ペコリーヌ", "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 294, 80003, 0, 0, 58, "キャル", "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 295, 80003, 0, 0, 51, "ペコリーヌ", "記念日だから\n平気平気♪\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 296, 80003, 0, 0, 59, "キャル", "意味分かんないわよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 297, 80003, 0, 0, 42, "コッコロ", "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 298, 80003, 0, 0, 43, "コッコロ", "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 299, 80003, 0, 0, 52, "ペコリーヌ", "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 300, 80003, 0, 0, 60, "キャル", "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 301, 80003, 0, 0, 44, "コッコロ", "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 302, 80003, 0, 0, 53, "ペコリーヌ", "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("105901,45,106001,61", 15, 0, 303, 80003, 0, 0, 54, "ペコリーヌ・コッコロ・キャル", "2.5周年\nありがとうございます！", 1, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 1, 304, 60002, 0, 1, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 305, 60002, 1, 1, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 306, 60002, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 307, 60002, 1, 1, 0, "", "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 308, 60002, 1, 1, 0, "", "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 309, 60002, 1, 2, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 310, 60002, 2, 1, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 311, 60002, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 312, 60002, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 313, 60002, 2, 1, 0, "", "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 314, 60002, 2, 2, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 315, 60002, 3, 1, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 316, 60002, 3, 1, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 317, 60002, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 318, 60002, 3, 1, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 319, 60002, 3, 1, 0, "", "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 320, 60002, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 321, 60002, 3, 2, 0, "", "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 322, 60002, 4, 1, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 323, 60002, 4, 1, 0, "", "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 324, 60002, 4, 1, 0, "", "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 325, 60002, 4, 1, 0, "", "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 326, 60002, 4, 1, 0, "", "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 327, 60002, 4, 1, 0, "", "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 328, 60002, 4, 2, 0, "", "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 3, 329, 60002, 0, 0, 2, "カリン", "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 3, 330, 60002, 0, 0, 3, "カリン", "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 4, 331, 80005, 0, 0, 1, "コッコロ", "ささ、シェフィさまはこちらへ…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 332, 80005, 0, 0, 1, "シェフィ", "コッコロさん、どこへ行くの…？\n…え？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 3, 333, 80005, 0, 0, 1, "ペコリーヌ", "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 4, 334, 80005, 0, 0, 2, "コッコロ", "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 335, 80005, 0, 0, 2, "シェフィ", "ええと…\n二人とも何をしているの？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 336, 80005, 0, 0, 1, "キャル", "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 337, 80005, 0, 0, 3, "シェフィ", "あの日…？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 3, 338, 80005, 0, 0, 2, "ペコリーヌ", "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 3, 339, 80005, 0, 0, 3, "ペコリーヌ", "『プリンセスコネクト！\nRe:Dive』3.5周年！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 340, 80005, 0, 0, 1, "カリン", "やばいですね☆", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 1, 341, 80005, 0, 0, 2, "キャル", "って、なにしれっと\n参加してんのよカリン！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 342, 80005, 0, 0, 2, "カリン", "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 2, 343, 80005, 0, 0, 3, "カリン", "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 3, 344, 80005, 0, 0, 4, "ペコリーヌ", "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 1, 0, 345, 80005, 0, 0, 4, "シェフィ", "えっ！？　ええとええと…！\nあ、あと14日…！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 3, 346, 80005, 0, 0, 5, "ペコリーヌ", "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 347, 80005, 0, 0, 3, "コッコロ", "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 348, 80005, 0, 0, 4, "コッコロ", "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 3, 349, 80005, 0, 0, 6, "ペコリーヌ", "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 350, 80005, 0, 0, 5, "コッコロ", "さすがでございます\nペコリーヌさま", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 351, 80005, 0, 0, 3, "キャル", "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 2, 352, 80005, 0, 0, 5, "シェフィ", "しゃなり、しゃなり…\nふふ、案外できるものね", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 3, 353, 80005, 0, 0, 7, "ペコリーヌ", "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 354, 80005, 0, 0, 6, "コッコロ", "さ、次はキャルさまの\n番でございますよ", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 355, 80005, 0, 0, 4, "キャル", "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 2, 356, 80005, 0, 0, 6, "シェフィ", "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 357, 80005, 0, 0, 5, "キャル", "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 358, 80005, 0, 0, 6, "キャル", "いたたた…もぉお～！\nなんであたしがこんな目に～！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 1, 359, 80005, 0, 0, 7, "コッコロ", "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 2, 0, 360, 80005, 0, 0, 7, "キャル", "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 361, 80005, 0, 0, 8, "コッコロ", "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 3, 362, 80005, 0, 0, 8, "ペコリーヌ", "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 363, 80005, 0, 0, 9, "コッコロ", "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 2, 364, 80005, 0, 0, 7, "シェフィ", "聖学祭…って、なにかしら？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 1, 365, 80005, 0, 0, 10, "コッコロ", "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 366, 80005, 0, 0, 8, "キャル", "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 367, 80005, 0, 0, 9, "キャル", "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 3, 368, 80005, 0, 0, 9, "ペコリーヌ", "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 0, 369, 80005, 0, 0, 10, "キャル", "いや、そのまんますぎでしょ…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 2, 370, 80005, 0, 0, 8, "シェフィ", "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 3, 371, 80005, 0, 0, 10, "ペコリーヌ", "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 3, 2, 372, 80005, 0, 0, 9, "シェフィ", "えっ？　ええ…\nぎゅーっ…？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 373, 80005, 0, 0, 11, "キャル", "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 2, 374, 80005, 0, 0, 10, "シェフィ", "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 375, 80005, 0, 0, 12, "キャル", "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 376, 80005, 0, 0, 11, "コッコロ", "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 377, 80005, 0, 0, 13, "キャル", "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 3, 378, 80005, 0, 0, 11, "ペコリーヌ", "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 379, 80005, 0, 0, 14, "キャル", "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 380, 80005, 0, 0, 15, "キャル", "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 2, 381, 80005, 0, 0, 11, "シェフィ", "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 3, 382, 80005, 0, 0, 12, "ペコリーヌ", "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 1, 383, 80005, 0, 0, 12, "コッコロ", "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 0, 384, 80005, 0, 0, 16, "キャル", "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 4, 2, 385, 80005, 0, 0, 12, "シェフィ", "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 386, 80005, 0, 0, 13, "ペコリーヌ", "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 387, 80005, 0, 0, 14, "ペコリーヌ", "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 388, 80005, 0, 0, 15, "ペコリーヌ", "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 389, 80005, 0, 0, 17, "キャル", "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 390, 80005, 0, 0, 18, "キャル", "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 2, 391, 80005, 0, 0, 13, "シェフィ", "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 1, 392, 80005, 0, 0, 13, "コッコロ", "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 393, 80005, 0, 0, 16, "ペコリーヌ", "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 0, 394, 80005, 0, 0, 19, "キャル", "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 395, 80005, 0, 0, 17, "ペコリーヌ", "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 396, 80005, 0, 0, 18, "ペコリーヌ", "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 5, 3, 397, 80005, 0, 0, 19, "ペコリーヌ", "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 398, 80005, 0, 0, 4, "カリン", "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 399, 80005, 0, 0, 5, "カリン", "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 400, 80005, 0, 0, 20, "キャル", "…えっ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 3, 401, 80005, 0, 0, 20, "ペコリーヌ", "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 402, 80005, 0, 0, 14, "シェフィ", "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 4, 403, 80005, 0, 0, 14, "コッコロ", "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 0, 404, 80005, 0, 0, 15, "シェフィ", "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 405, 80005, 0, 0, 21, "キャル", "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 3, 406, 80005, 0, 0, 21, "ペコリーヌ", "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 1, 407, 80005, 0, 0, 22, "キャル", "ぶっ殺すぞ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 6, 2, 408, 80005, 0, 0, 6, "カリン", "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 1, 409, 80005, 0, 0, 15, "コッコロ", "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 410, 80005, 0, 0, 23, "キャル", "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 2, 411, 80005, 0, 0, 16, "シェフィ", "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 3, 412, 80005, 0, 0, 22, "ペコリーヌ", "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 413, 80005, 0, 0, 24, "キャル", "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 2, 414, 80005, 0, 0, 17, "シェフィ", "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 1, 415, 80005, 0, 0, 16, "コッコロ", "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 2, 416, 80005, 0, 0, 18, "シェフィ", "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 1, 417, 80005, 0, 0, 17, "コッコロ", "もちろんでございます\n仲良くお勉強いたしましょう", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 418, 80005, 0, 0, 25, "キャル", "しれっと教育ママが\n生まれてる…？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 3, 419, 80005, 0, 0, 23, "ペコリーヌ", "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 7, 0, 420, 80005, 0, 0, 26, "キャル", "え～～～～！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 421, 80005, 0, 0, 27, "キャル", "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 2, 422, 80005, 0, 0, 19, "シェフィ", "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 1, 423, 80005, 0, 0, 18, "コッコロ", "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 3, 424, 80005, 0, 0, 24, "ペコリーヌ", "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 2, 425, 80005, 0, 0, 20, "シェフィ", "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 426, 80005, 0, 0, 28, "キャル", "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 1, 427, 80005, 0, 0, 19, "コッコロ", "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 2, 428, 80005, 0, 0, 21, "シェフィ", "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 429, 80005, 0, 0, 29, "キャル", "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 430, 80005, 0, 0, 30, "キャル", "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 3, 431, 80005, 0, 0, 25, "ペコリーヌ", "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 8, 0, 432, 80005, 0, 0, 31, "キャル", "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 433, 80005, 0, 0, 22, "シェフィ", "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 434, 80005, 0, 0, 23, "シェフィ", "…えっ？\n生放送の意気込み！？\n突然なに！？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 435, 80005, 0, 0, 24, "シェフィ", "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 436, 80005, 0, 0, 25, "シェフィ", "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 437, 80005, 0, 0, 26, "シェフィ", "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 438, 80005, 0, 0, 27, "シェフィ", "それから、それから…！\nぅ、ぅぅっ…！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 439, 80005, 0, 0, 28, "シェフィ", "―びえぇぇ～んっ！！！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 1, 440, 80005, 0, 0, 20, "コッコロ", "どうされましたか、シェフィさま", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 441, 80005, 0, 0, 29, "シェフィ", "ううっ…ひっく…\nママッ…！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 1, 442, 80005, 0, 0, 21, "コッコロ", "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 1, 443, 80005, 0, 0, 22, "コッコロ", "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 9, 0, 444, 80005, 0, 0, 30, "シェフィ", "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 445, 80005, 0, 0, 23, "コッコロ", "主さま\n3.5周年まであと５日\nでございます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 446, 80005, 0, 0, 24, "コッコロ", "ですがその前に\n生放送がありますね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 447, 80005, 0, 0, 25, "コッコロ", "…生放送に向けた\n意気込みでございますか？", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 448, 80005, 0, 0, 26, "コッコロ", "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 449, 80005, 0, 0, 27, "コッコロ", "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 450, 80005, 0, 0, 28, "コッコロ", "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 451, 80005, 0, 0, 29, "コッコロ", "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 452, 80005, 0, 0, 30, "コッコロ", "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 10, 0, 453, 80005, 0, 0, 31, "コッコロ", "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 454, 80005, 0, 0, 26, "ペコリーヌ", "3.5周年まであと４日！\nやばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 1, 455, 80005, 0, 0, 32, "キャル", "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 456, 80005, 0, 0, 27, "ペコリーヌ", "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 457, 80005, 0, 0, 28, "ペコリーヌ", "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 458, 80005, 0, 0, 29, "ペコリーヌ", "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 1, 459, 80005, 0, 0, 33, "キャル", "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 460, 80005, 0, 0, 30, "ペコリーヌ", "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 461, 80005, 0, 0, 31, "ペコリーヌ", "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 462, 80005, 0, 0, 32, "ペコリーヌ", "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 1, 463, 80005, 0, 0, 34, "キャル", "だからあたしはやるなんて一言も…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 0, 464, 80005, 0, 0, 33, "ペコリーヌ", "オイッスー☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 11, 1, 465, 80005, 0, 0, 35, "キャル", "聞きなさいっての！！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 466, 80005, 0, 0, 31, "シェフィ", "3.5周年まであと３日…\nそして生放送は、明日…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 467, 80005, 0, 0, 32, "シェフィ", "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 468, 80005, 0, 0, 33, "シェフィ", "おいっす！\n…こうじゃなかったわね\nええと確か…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 469, 80005, 0, 0, 34, "シェフィ", "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 470, 80005, 0, 0, 35, "シェフィ", "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 3, 471, 80005, 0, 0, 34, "ペコリーヌ", "やってますねシェフィちゃん！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 0, 472, 80005, 0, 0, 36, "キャル", "なによ、考えることは\nみんな同じってこと？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 1, 473, 80005, 0, 0, 32, "コッコロ", "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 2, 474, 80005, 0, 0, 36, "シェフィ", "みんな…もちろんよ！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 12, 3, 475, 80005, 0, 0, 35, "ペコリーヌ", "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 476, 80005, 0, 0, 7, "カリン", "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 477, 80005, 0, 0, 8, "カリン", "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 3, 478, 80005, 0, 0, 36, "ペコリーヌ", "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 479, 80005, 0, 0, 9, "カリン", "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 4, 480, 80005, 0, 0, 33, "コッコロ", "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 481, 80005, 0, 0, 10, "カリン", "さすが【美食殿】のママですね！\nそしてキャルさんは…", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 482, 80005, 0, 0, 37, "キャル", "大丈夫…大丈夫…\nあたしは大丈夫…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 483, 80005, 0, 0, 11, "カリン", "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 0, 484, 80005, 0, 0, 37, "シェフィ", "あうー？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("105901,34,106001,38,190801,12", 13, 4, 485, 80005, 0, 0, 37, "みんな", "あ…", 1, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 1, 486, 80005, 0, 0, 39, "キャル", "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 4, 487, 80005, 0, 0, 35, "コッコロ", "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 3, 488, 80005, 0, 0, 38, "ペコリーヌ", "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 13, 2, 489, 80005, 0, 0, 13, "カリン", "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 490, 80005, 0, 0, 38, "シェフィ", "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 3, 491, 80005, 0, 0, 39, "ペコリーヌ", "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 492, 80005, 0, 0, 40, "キャル", "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 1, 493, 80005, 0, 0, 36, "コッコロ", "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 494, 80005, 0, 0, 39, "シェフィ", "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 3, 495, 80005, 0, 0, 40, "ペコリーヌ", "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 1, 496, 80005, 0, 0, 37, "コッコロ", "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 0, 497, 80005, 0, 0, 41, "キャル", "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 498, 80005, 0, 0, 40, "シェフィ", "へ、へぇ…", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 3, 499, 80005, 0, 0, 41, "ペコリーヌ", "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 500, 80005, 0, 0, 41, "シェフィ", "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 14, 2, 501, 80005, 0, 0, 42, "シェフィ", "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 3, 502, 80005, 0, 0, 42, "ペコリーヌ", "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 503, 80005, 0, 0, 42, "キャル", "祝！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 4, 504, 80005, 0, 0, 38, "コッコロ", "3.5周年！", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 505, 80005, 0, 0, 43, "シェフィ", "おめでとうございます！", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 506, 80005, 0, 0, 14, "カリン", "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 2, 507, 80005, 0, 0, 15, "カリン", "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 0, 190801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 3, 508, 80005, 0, 0, 43, "ペコリーヌ", "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 3, 509, 80005, 0, 0, 44, "ペコリーヌ", "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 510, 80005, 0, 0, 43, "キャル", "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 1, 511, 80005, 0, 0, 44, "キャル", "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 0, 106001);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 512, 80005, 0, 0, 44, "シェフィ", "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 0, 513, 80005, 0, 0, 45, "シェフィ", "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 0, 106401);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 4, 514, 80005, 0, 0, 39, "コッコロ", "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 4, 515, 80005, 0, 0, 40, "コッコロ", "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 4, 516, 80005, 0, 0, 41, "コッコロ", "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 0, 105901);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 15, 3, 517, 80005, 0, 0, 45, "ペコリーヌ", "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 0, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("105901,42,106001,45,106401,46,190801,16", 15, 4, 518, 80005, 0, 0, 46, "みんな", "これからも\nよろしくおねがいします！", 1, 105801);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 1, 519, 60003, 0, 1, 1, "カリン", "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 0, 190804);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 520, 60003, 1, 1, 0, "", "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 521, 60003, 1, 1, 0, "", "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 522, 60003, 1, 1, 0, "", "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 523, 60003, 1, 1, 0, "", "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 524, 60003, 1, 2, 0, "", "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 525, 60003, 2, 1, 0, "", "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 526, 60003, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 527, 60003, 2, 1, 0, "", "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 528, 60003, 2, 1, 0, "", "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 529, 60003, 2, 2, 0, "", "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 530, 60003, 3, 1, 0, "", "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 531, 60003, 3, 1, 0, "", "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 532, 60003, 3, 1, 0, "", "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 533, 60003, 3, 1, 0, "", "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 534, 60003, 3, 1, 0, "", "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 535, 60003, 3, 1, 0, "", "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 536, 60003, 3, 2, 0, "", "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 2, 537, 60003, 4, 1, 0, "", "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 0);
